import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import DateTimePicker from 'react-datetime-picker';
import DashBoard from './DashBoard';

class App extends Component {
  constructor(props){
    super(props)
    this.state = {
      date: new Date(),
    }
  }

  onChange = date => this.setState({ date })

 render(){
  return (
    <div className="App">
      <DashBoard/>

    </div>
  );
 } 
}

export default App;
